import React from 'react';

const Footer=()=>{
    return(
        <div className='footer'>
            <h3>E-comm DashBoard</h3>
            <input type="text" placeholder='Enter Your ProductName' />
            <input type="number" placeholder='Enter Your Price' />
            <input type="text" placeholder='Enter Your ProductName' />
            <input type="text" placeholder='Enter Your ProductName' />
        
        </div>
    )
}

export default Footer;
